import React, { useState } from 'react';
import { Menu } from 'antd';
import {
    HomeOutlined,
    LoginOutlined,
    UserOutlined,
    UserAddOutlined,
} from '@ant-design/icons';

const { SubMenu, Item } = Menu; // Menu.subMenu

const Header = () => {

    const [current, setCurrent] = useState('home');


    const handleClick = (e) => {
        // console.log(e.key);
        setCurrent(e.key);
    };

    return (
        <Menu onClick={handleClick} selectedKeys={[current]} mode="horizontal">
            <Menu.Item key="home" icon={<HomeOutlined />}>
                Home
        </Menu.Item>


            <Menu.Item key="register" icon={<UserAddOutlined />} className="float-right">
                Register
        </Menu.Item>

            <Menu.Item key="login" icon={<LoginOutlined />} className="float-right" >
                Login
        </Menu.Item>



            <SubMenu icon={<UserOutlined />} title="Username" >
                    <Menu.Item key="setting:1">Option 1</Menu.Item>
                    <Menu.Item key="setting:2">Option 2</Menu.Item>
            </SubMenu>
        </Menu>
    )
};
export default Header;
